/* Function: mdlOutputs =======================================================
 *
 */
static void mdlOutputs(SimStruct *S, int_T tid)
{
  const real_T *sensorCabineTemp = (real_T *) ssGetInputPortRealSignal(S, 0);
  const real_T *targetPosition = (real_T *) ssGetInputPortRealSignal(S, 1);
  const real_T *FlapMotorPosition = (real_T *) ssGetInputPortRealSignal(S, 2);
  const real_T *sensorSun = (real_T *) ssGetInputPortRealSignal(S, 3);
  const real_T *blowerMotorCurrent = (real_T *) ssGetInputPortRealSignal(S, 4);
  const real_T *sensorAirQuality = (real_T *) ssGetInputPortRealSignal(S, 5);
  const int32_T *evaporatorSensorOpenCircuit = (int32_T *)
    ssGetInputPortRealSignal(S, 6);
  const real_T *evaporatorTemp = (real_T *) ssGetInputPortRealSignal(S, 7);
  const real_T *fanSpeed = (real_T *) ssGetInputPortRealSignal(S, 8);
  const int32_T *VIN = (int32_T *) ssGetInputPortRealSignal(S, 9);
  const real_T *time = (real_T *) ssGetInputPortRealSignal(S, 10);
  const real_T *value = (real_T *) ssGetInputPortRealSignal(S, 11);
  const int32_T *functionCode = (int32_T *) ssGetInputPortRealSignal(S, 12);
  const int32_T *code = (int32_T *) ssGetInputPortRealSignal(S, 13);
  const int32_T *serviceId = (int32_T *) ssGetInputPortRealSignal(S, 14);
  int32_T *response = (int32_T *) ssGetOutputPortRealSignal(S, 0);
  int32_T *responseStatusCode = (int32_T *) ssGetOutputPortRealSignal(S, 1);
  SERVICEECU_Outputs_wrapper(sensorCabineTemp, targetPosition, FlapMotorPosition,
    sensorSun, blowerMotorCurrent, sensorAirQuality, evaporatorSensorOpenCircuit,
    evaporatorTemp, fanSpeed, VIN, time, value, functionCode, code, serviceId,
    response, responseStatusCode);
}

